import fire from '@/fb.js'
export default {
  data () {
    return {
      dialog: false,
      mail: '',
      pass: '',
      user: ''
    }
  },
  methods: {
    logIn () {
      fire.auth.signInWithEmailAndPassword(this.mail, this.pass)
        .then(cred => {
          console.log(cred)
          this.user = cred.user.email
          this.$store.commit('userLogged', this.user)
        })
      this.dialog = false
    }
  }
}
